import React, { useState } from "react";
import ReactDOM from "react-dom/client";

const success = ({ result, message }) => {
  return (
    <div id="success">
      {{ message } ? (
        <>
          <h4>Success</h4>
          <h2>{result}</h2>
        </>
      ) : (
        <>
          <h3>Fail</h3>
          <h2>{message}</h2>
        </>
      )}
    </div>
  );
};

export default success;
